import { useEffect } from "react"
import { useState } from "react"
import "./App.css"
function Home() {
  const [data, setData] = useState([])
  // cosnt[Value, setValue] = useState()
  // const [sort, setSort] = useState()

  useEffect(() => {
    fetch("http://localhost:3008/Products")
      .then((res) => {
        return res.json()
      })
      .then((resp) => {
        setData(resp)
      })
  }, [])

  return (
    
      <div class="navbar navbar-expand-lg bg-body-info fs-5">
        <div class="container-fluid">
          <a class="navbar-brand" href="#"><img src="https://www.zarla.com/images/zarla-our-kitchen-1x1-2400x2400-20210607-g7q69ybhqxvvy7rtwvvj.png?crop=1:1,smart&width=250&dpr=2" alt="" style={{ width: "100px", height: "80px" }} /></a>
          <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse" id="navbarSupportedContent">
            <ul class="navbar-nav me-auto mb-2 mb-lg-0 mx-5">
              <form class="d-flex">
                <input class="form-control ms-5 me-1" type="text" placeholder="Search your product" />
                <button class="btn btn-outline-success" type="submit">Search</button>
              </form>
            </ul>
            <span class="navbar-text mx-5 d-flex">
              <div class="nav-item">
                <a class="nav-link mx-5" href="#">
                  <i class="bi bi-cart-plus-fill h3"></i>
                  <span class="position-absolute top-7 start-70 fs-6 translate-middle badge rounded-pill bg-danger">
                    0
                    <span class="visually-hidden"></span>
                  </span></a>
              </div>
              <a class="nav-link"><i class="bi bi-person-circle" style={{ fontSize: "20px" }}></i>User</a>
            </span>
            <div class="d-flex" role="search">
              <button class="btn btn-outline-success" type="submit">Logout</button>
            </div>
          </div>
        </div>
      </div>
      
    

  )
}



export default Home;
